interface ISmolBirb {
    function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId
    ) external;
}

pragma solidity 0.8.13;

contract EthBridge is IERC721Receiver, Ownable, Pausable {
    using ECDSA for bytes32;

    ISmolBirb public immutable smolBirb;

    address public signer = 0x21dfea78442657c9c61802b879B5B2d4A2783f66;

    mapping(uint256 => bool) public nonceUsed;

    event Deposit(address depositor, uint256[] tokenIds);
    event Withdraw(address withdrawer, uint256[] tokenIds);

    constructor(ISmolBirb _smolBirbAddress) {
        smolBirb = _smolBirbAddress;
    }

    function changeSigner(address _newSigner) external onlyOwner {
        require(_newSigner != address(0), "Zero Address");
        signer = _newSigner;
    }

    function pause() external onlyOwner {
        _pause();
    }

    function unPause() external onlyOwner {
        _unpause();
    }

    function onERC721Received(
        address,
        address,
        uint256,
        bytes memory
    ) external pure override returns (bytes4) {
        return this.onERC721Received.selector;
    }

    function deposit(uint256[] calldata tokenIds) external whenNotPaused {
        for (uint256 i; i < tokenIds.length; ) {
            smolBirb.safeTransferFrom(msg.sender, address(this), tokenIds[i]);
            unchecked {
                ++i;
            }
        }
        emit Deposit(msg.sender, tokenIds);
    }

    function withdraw(
        uint256[] calldata tokenIds,
        bytes calldata signature,
        uint256 nonce
    ) external whenNotPaused {
        require(!nonceUsed[nonce], "Nonce already used");
        require(
            keccak256(abi.encodePacked("1", msg.sender, tokenIds, nonce))
                .toEthSignedMessageHash()
                .recover(signature) == signer,
            "Signature not valid"
        );
        nonceUsed[nonce] = true;
        for (uint256 i; i < tokenIds.length; ) {
            smolBirb.safeTransferFrom(address(this), msg.sender, tokenIds[i]);
            unchecked {
                ++i;
            }
        }
        emit Withdraw(msg.sender, tokenIds);
    }
}

